import React from 'react';
import './App.css';

import Header from './components/header';
import Footer from './components/footer';
import { BrowserRouter, Route } from 'react-router-dom';
import { Routes } from 'react-router';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Header />
        <Routes />
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
